import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <header className="App-header">

        <p className="App-story">
        write something hear 
        interests 
        goals 
        why i want to work at sovetech
        </p>

      </header>
    </div>
  );
}

export default App;
